import React, { useState, useEffect } from 'react'
import axios from 'axios'

// const HomePage = () => {
//     return (
//         <h1>Spaceagram</h1>

//     )
// }

function HomePage() {
    const [images, setImages] = useState([])

    useEffect(() => {
        axios.get('https://jsonplaceholder.typicode.com/posts')
        .then( res => {
            console.log(res)
        })
        .catch( err => {
            console.log(err)
        })
    })
    return (
        <div>
            <h1>Spaceagram</h1>
            <ul>
                {
                    images.map(post => (<li key={post.id}> {post.title} </li>
                    ))
                }
            </ul>
        </div>
    )
}

export default HomePage
